const items = [
  <h1>Hello World</h1>,
  <h1>Hello</h1>,
  <h1>Hello</h1>,
  <h1>Hello</h1>,
  
];
const responsive = [
  {
    0: {
        items: 1,
    },
    800: {
        items: 3
    }
  }
  
];

const ProCrousel = () => {
  return (
    <AliceCarousel mouseTracking responsive={responsive} infinite={true} items={items} />
  );
}

